import React from 'react';

const SummaryDisplay: React.FC<{ summary: string }> = ({ summary }) => {
    return (
        <div className="p-2 border rounded bg-gray-100">
            {summary || "The summary will appear here..."}
        </div>
    );
};

export default SummaryDisplay;
